import React from 'react';
import classnames from 'classnames';
import styles from './CustomIcon.scss';

// 引入iconfont.js
const scriptElem = document.createElement('script');
scriptElem.src = 'assets/fonts/iconfont.js';
document.body.appendChild(scriptElem);


const CustomIcon:React.FC<{ type: String, className: String}> = ({ className, type, ...restProps }) => {
    return (
        <svg
          className={classnames(styles['super-icon'], className)}
          aria-hidden="true"
          {...restProps}
        >
          <use xlinkHref={`#${type}`} />
        </svg>
      );
};

export default CustomIcon;
